import Card from "./card";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card name="BEYONCE" img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg" tel="9419656" email="beyonce@gmail.com" />
      <Card name="JHONY" img="https://www.google.com/search?q=justin+bieber&bih=649&biw=1309&hl=en-GB&sxsrf=APwXEdcch2IDbHegxkjUm6apgwQ8ge_IGg%3A1679819489183&ei=4QIgZKrkCpiB-AaY3ap4&ved=0ahUKEwjq2MGfl_n9AhWYAN4KHZiuCg8Q4dUDCA8&uact=5&oq=justin+bieber&gs_-HGgBcAF4AIABtwOIAeAZkgEJMC4xLjQuNS4xmAEAoAEBsAEUwAEB2gEGCAEQARgB&sclient=gws-wiz-serp#" tel="901895464" email="justin@gmail.com"/>
    </div>
  );
}

export default App;
